def lengthOfLongestSubstring(s):
    
    for i in range(len(set(s)), 0, -1):
        for j in range(len(s)-i+1):
            sub = s[j:i+j]
            if len(set(sub)) == len(list(sub)):
                return i          
    return 0

    
